import React from 'react';
import ReactDOM from 'react-dom';
import './styles.css';
import profileIcon from './Images/profileIcon.png';
import shoppingCartIcon from './Images/shoppingCart.png';
import shoppingIconIcon from './Images/shoppingIcon.png';

class NavBar extends React.Component {
    render() {
      return (
        <div>
          <ul>
            <li style={{listStyleType: "none"}}><a className="nav-link" href="#">Home</a></li>
            <li><a className="nav-link" href="nav-pages/about-me.html">About Me</a></li>
            <li><a className="nav-link" href="#stickers">Stickers</a></li>
            <li><a className="nav-link" href="nav-pages/custom-order.html">Custom Order</a></li>
            <li><a className="nav-link" href="nav-pages/contact-me.html">Contact Me</a></li>
            <li className="nav-images-li">
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw", marginTop: "7px"}} src={profileIcon} alt="profile icon"></img></a></li>
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw"}} src={shoppingCartIcon} alt="shopping cart icon icon"></img></a></li>
              <li><a href="icon-pages/login-profile.html"><img style={{width: "3vw", marginTop: "7px"}} src={shoppingIconIcon} alt="shopping icon"></img></a></li>
            </li>
          </ul>
        </div>
      );
    }
}

export default NavBar;
